import React from 'react'

export default function QualityQuestion(props) {
  return props.questionData.itemName ? (
    <div>
          What <div style={{backgroundColor: "var(--highlight-text)"}}>Quality</div> does the item {props.questionData.itemName} have?
    </div>
  ) : null;
}
